const http = require('http');

http.createServer((req, res) => {
    res.writeHead(200, { 'Content-Type': 'text/html' });
    res.write('<html><body>');
    res.write('<h1>Hello from Node.js</h1>');
    res.write('</body></html>');
    res.end();
}).listen(3000);

console.log('Server running at http://localhost:3000/');
